Wolverine is a mutant with an unbreakable skeleton, retractable adamantium claws, and a healing ability that reverses nearly any wound. His past however, is shrouded in mystery. Calling himself Logan, Wolverine spent years trying to unravel the layers of his own history. Will Domino, a female mutant with luck abilities, help Wolverine stich together the threads of his past? And what about the insidious Sabretooth... can Wolverine help Domino find him? They track Wolverine's more brutal counterpart, but must face Lady Deathstrike and Deadpool along the way. The trio prove to be to much for Wolverine and Domino; it'll take Phoenix and Rogue to save them! All knives are out as Axel Braun presents his new Superhero epic, Wolverine!

